import axios from "axios"

с

export const UsersApi = (pageSize,currentPage) => {
  return (
    axios
    .get(
      `http://localhost:3001/data?_limit=${pageSize}&_page=${currentPage}`,{
        withCredentials:true
      }
    )
  )
}
